import React, { Component } from "react";
import FormPage from "./components/form";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      newTest: {
        layer: { default: "Network", selected: "Network" },
        testType: { default: "Network", selected: "Network" },
        testName: "",
        testDescription: "",
      },
      basicConfig: {
        target: "",
        protocol: { default: "TCP", selected: "TCP" },
        probing: { default: "Prefer SACK", selected: "Prefer SACK" },
        pathTrace: false,
        // interval: { default: defaultInterval },
        // agents: { defaultAgents },
        // alerts: { enable: { defaultEnable }, rules: { defaultRuleSelect } },
      },
    };
  }
  render() {
    const { newTest, basicConfig } = this.state;

    return <FormPage newTest={newTest} basicConfig={basicConfig} />;
  }
}

export default App;
